import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Grid from '@material-ui/core/Grid';
import MomChild from '../MomChild'
import medicines from '../Medicines';
import hygiene from '../Hygiene';
import PaiCramp from '../PainCramp'

// const products = [
//   { name: 'Product 1', desc: 'A nice thing', price: '$9.99' },
//   { name: 'Product 4', desc: 'Best thing of all', price: '$14.11' },
// ];

const data = [
    {
        name: 'Medicines',
        info: 'jsljal',
        id: 1,
        img: 'https://medex.am/_mx/uploads/topics/images/headache-medication.jpg?h=203&w=370',
        // component : Mercedes,
        data: medicines
    },
    {
        name: 'Hygiene',
        info: 'dsjakxsa',
        id: 2,
        img: 'https://cdn.shopify.com/s/files/1/1600/4387/products/1-DVL-hero.png?v=1573838539',
        // component : Toyota,
        data: hygiene
    },
    {
        name: 'Mom and child',
        info: 'jsljal',
        id: 3,
        img: 'https://i3.imgbb.ru/img8/2/d/a/2daef2b3448b29891f9875fbcb814095.jpg',
        data: MomChild

    },
    {
        name: 'Pain and Cramp',
        info: 'dsjakxsa',
        id: 4,
        img: 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSy2s8AWh328dmSUHAFCObHMq6NPp2rKtt2Jg&usqp=CAU',
        data: PaiCramp
    },
    {
        name: 'Stomatologia',
        info: 'jsljal',
        id: 5,
        img: 'https://cool-info.ru/wp-content/uploads/2018/09/zdorovie_zubi.JOabh_.jpg',
    },
    {
        name: 'Kosmetologia',
        info: 'dsjakxsa',
        id: 6,
        img: 'https://mamul.am/images/photos/160312/garnany-kariq-ka-pho-n81148-1.jpg',
    },
    {
        name: 'Mankabarc',
        info: 'jsljal',
        id: 7,
        img: 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcT-uqLwy3rwRuvxUyA88Nsm76ER-JdYP3TvKA&usqp=CAU',
    },
    {
        name: 'Aknabuj',
        info: 'dsjakxsa',
        id: 8,
        img: 'https://www.gapex.am/images/clinic/7.jpg',
    },
]

const addresses = ['1 Material-UI Drive', 'Reactville', 'Anytown', '99999', 'USA'];
const payments = [
  { name: 'Expiry date' },
];

const useStyles = makeStyles((theme) => ({
  listItem: {
    padding: theme.spacing(1, 0),
  },
  total: {
    fontWeight: 700,
  },
  title: {
    marginTop: theme.spacing(2),
  },
}));

export default function Review() {
  const classes = useStyles();

  return (
    <React.Fragment>
      <Typography variant="h6" gutterBottom>
        Order summary
      </Typography>
      <List disablePadding>
        {hygiene.map((product) => (
          <ListItem className={classes.listItem} key={product.name}>
            <ListItemText primary={product.name} secondary={product.desc} />
            <Typography variant="body2">{product.info}</Typography>
          </ListItem>
        ))}
        <ListItem className={classes.listItem}>
          <ListItemText primary="Total" />
          <Typography variant="subtitle1" className={classes.total}>
            $34.06
          </Typography>
        </ListItem>
      </List>
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6}>
          <Typography variant="h6" gutterBottom className={classes.title}>
            Shipping
          </Typography>
          <Typography gutterBottom>John Smith</Typography>
          <Typography gutterBottom>{addresses.join(', ')}</Typography>
        </Grid>
        <Grid item container direction="column" xs={12} sm={6}>
          <Typography variant="h6" gutterBottom className={classes.title}>
            Payment details
          </Typography>
          <Grid container>
            {payments.map((payment) => (
              <React.Fragment key={payment.name}>
                <Grid item xs={6}>
                  <Typography gutterBottom>{payment.name}</Typography>
                </Grid>
               
              </React.Fragment>
            ))}
          </Grid>
        </Grid>
      </Grid>
    </React.Fragment>
  );
}
